import React from "react";
const myImg = "../images/rose_quartz.png";

export const CrystalCard = (props) => {
  console.log(props);
  return (
    <div>
      <img alt="crystal" src={require(`${myImg}`)} />
      <p key={props.crystal.id}>{props.crystal.name}</p>
      <em>{props.crystal.purpose}</em>
    </div>
  );
};
